    false,nt"url": null,nt"notes": "This Public Hunting and Fishing Plan for
    Parker River National Wildlife Refuge outlines refuge objectives; program policies;
    the program description; and program data. The proposed program will create some
    dispersal of waterfowl and improve hunting adjacent to the refuge on the north and
    south boundaries. The program will aid in keeping waterfowl moving in an orderly
    manner south along the Atlantic Flyway. Surf fishing will be available from May
    to October; however, no fresh water fishing is available.",nt"license_title":
